import React from "react";

export default function MainWindow(props) {
  const title = props.title,
        items = props.items;

  return (
    <section>
      <h2>{title}</h2>
      {items
        ? items.map((items) => {
            console.log(items);
          })
        : console.log("loading")}
    </section>
  );
}
